import React from "react";

function Footer() {
  return (
    <div className="container">
      <div className="row">
        <div className="col"></div>
        <div className="col"></div>
        <div className="col"></div>
        <div className="col"></div>
      </div>
    </div>
  );
}

export default Footer;
